import { count } from "yargs";
import Header from "./Header";

const Expenses = (props) => {
  return (
    <React.Fragment>
      {!count(props.tasks) && (
        <Header name="No Tasks Found..!! Try by adding new..!!" />
      )}
    </React.Fragment>
  );
};

export default Expenses;
